import React, { Component } from 'react';
import { useNavigate } from "react-router-dom";
import './dop.css';

  const Dop = (props) => {
    const navigate = useNavigate(); 
    return (
      <div className='dope'>
        <p><strong className='dev'>Developers </strong><strong className='yell'>Outreach Program </strong> <span>The Best Coding Training Program in Tanzania</span></p>
        <button className='btn3' onClick={() => navigate("/Form")}>APPLY NOW!</button>
      </div>
    )
  
  }
 
export default Dop;
